import React from "react";
import "./styles/char.css";

export default function Char() {
  return (
    <div className="char">
      <div className="char__menu">
        <p className="char__menu-opt">Описание</p>
        <p className="char__menu-opt">Характеристики</p>
        <p className="char__menu-opt">Видеообзор</p>
      </div>
    </div>
  );
}
